import React from 'react';
import s from './MyPosts.module.css';

const MyPosts = () => {
    return (
        
                <div className = {`${s.content} ${s.head}`}>
                    My posts
                    <div className = {`${s.content} ${s.head}`}>
                        New post
                    </div>
                <div className = {s.posts}>
                    <div className = {s.item}>
                        <img src='https://pickimage.ru/wp-content/uploads/images/detskie/animalpopart/zhivotniepopart2.jpg' />
                        post 1
                    </div>
                    <div className = {s.item}>
                        post 2
                    </div>
                </div>
                </div>
        
    );
}

export default MyPosts;
